import React from "react";
import Card from "../UI/Card";

const Meals = (props) => {
  return (
    <Card>
      <li>
        <h2>{props.name}</h2>
        <h3>{props.description}</h3>
        <div>{props.amount}</div>
      </li>
    </Card>
  );
};

export default Meals;
